    public static void otpDecoder(String cipher, String key){
        var cipherArray = cipher.toCharArray();
        var keyArray = key.toCharArray();
        char[] decodedCipherChars = new char[cipherArray.length];
        int index = 0;
        for (var bit:cipherArray) {
            if(keyArray[index] == cipherArray[index]) {
                decodedCipherChars[index]='0';
            }
            else {
                decodedCipherChars[index]='1';
            }
            index++;
        }
        Path file = Path.of("C:\\Studium Zeug\\3. Semester\\Computersystemsicherheit\\Java Hilfsprojekte\\decodedCipher.bin");
        try (OutputStream out = new BufferedOutputStream(
                Files.newOutputStream(file))) {
            var decodedString = new String(decodedCipherChars);
            System.out.println(decodedString);
            int byteCount = (decodedString.length() + 7) / 8;
            byte[] byteArray = new byte[byteCount];
            // Convert each group of 8 bits (or less) into a byte
            for (int i = 0; i < decodedString.length(); i++) {
                if (decodedString.charAt(i) == '1') {
                    byteArray[i / 8] |= (1 << (7 - (i % 8)));  // Set the bit in the byte
                }
            }
            out.write(byteArray, 0, byteArray.length);
        } catch (IOException x) {
            System.err.println(x);
        }
    }

