    public static String decodeKeyUsingCBC(){
        Path file = Path.of("C:\\Studium Zeug\\3. Semester\\Computersystemsicherheit\\Java Hilfsprojekte\\otpkey.bin");
        try (InputStream in = Files.newInputStream(file);
             BufferedReader reader =
                     new BufferedReader(new InputStreamReader(in))) {
            String line = null;
            StringBuilder dectryptedOTPKey = new StringBuilder();
            String IV = "10011001";
            char[] previousByteString = IV.toCharArray();
            while ((line = reader.readLine()) != null) {
                var hexBytes = line.getBytes();
                for (var byteVar:hexBytes) {
                    String s1 = String.format("%8s", Integer.toBinaryString(byteVar & 0xFF)).replace(' ', '0');
                    char[] codedByteString = s1.toCharArray();
                    char[] decodedByteString = new char[codedByteString.length];

                    decodedByteString[6] = codedByteString[0];
                    decodedByteString[0] = codedByteString[1];
                    decodedByteString[5] = codedByteString[2];
                    decodedByteString[7] = codedByteString[3];
                    decodedByteString[4] = codedByteString[4];
                    decodedByteString[2] = codedByteString[5];
                    decodedByteString[3] = codedByteString[6];
                    decodedByteString[1] = codedByteString[7];

                    char[] xoredByteString = new char[decodedByteString.length];
                    for (int i = 0; i < decodedByteString.length; i++) {
                        if(decodedByteString[i]==previousByteString[i]){
                            xoredByteString[i]='0';
                        }
                        else{
                            xoredByteString[i]='1';
                        }
                    }
                    previousByteString = codedByteString;

                    s1 = new String(xoredByteString);
                    dectryptedOTPKey.append(s1);
                }
            }
            System.out.println(dectryptedOTPKey.toString());
            return dectryptedOTPKey.toString();
        } catch (IOException x) {
            System.err.println(x);
        }
        return null;
    }

